import React from 'react'

const PriceInfo = props => (
    <div className='price_info'>
        {
            props.month && <p className='weather__key'>Month : 
                <span className='weather__value'> {props.month} </span>
            </p>
           }
           {
            props.year && <p className='weather__value'>Year :  
                {props.year}
            </p>  
        }
          {
            props.price && <p>Price : 
                {props.price}
            </p> 
        }

    </div>
)

export default PriceInfo
